import React from "react";

function Homepage() {
  return (
    <div className="main-div">
      <div className="sub-div">
        <div className="sub-sub-div henna">

        </div>
        <div className="sub-sub-div manicure"></div>
        <div className="sub-sub-div art"></div>
        <div className="sub-sub-div facepainting"></div>
      </div>
      <div className="sub-div">
        <div className="sub-sub-div nailart"></div>
        <div className="sub-sub-div diyapainting"></div>
      </div>
    </div>
  );
}

export default Homepage;
